import { Text } from ".";

const Vin = ({ bg, color, name }) => {
  return (
    <div
      className="w-52 h-72 rounded-lg p-5 relative cursor-pointer"
      style={{
        background: `url(${bg})`,
        backgroundRepeat: "no-repeat",
        backgroundSize: "cover",
      }}
    >
      <div className="absolute bottom-4 ">
        <div
          className="w-24 h-2 rounded-xl"
          style={{ background: color }}
        ></div>
        <Text.h4 color={"white"}>{name}</Text.h4>
      </div>
    </div>
  );
};

const Produit = ({ bg, color, type, name, pays, oldPrice, price, link }) => {
  return (
    <div
      className="w-52 h-72 rounded-lg p-5 cursor-pointer"
      style={{
        background: `url(${bg})`,
        backgroundRepeat: "no-repeat",
        backgroundSize: "contain",
      }}
    >
      <div className="">
        <div
          className="w-24 h-2 rounded-xl"
          style={{ background: color }}
        ></div>
        <Text.h4 color={"white"}>{name}</Text.h4>
      </div>
    </div>
  );
};

export { Vin, Produit };
